strings:
#skin-close{
  display: none;
}
/* .qq-body-skin{
  background-color: #d20001!important;
} */
.qq-body-skin .layout{
  margin-bottom:0;
  padding-bottom: 20px;
}
.qq-body-skin .qq-skin,
.qq-body-skin .qq-top{
  padding-bottom: 0;
}
.garyBody{
  filter: grayscale(100%);
  -webkit-filter: grayscale(100%);
  -moz-filter: grayscale(100%);
  -ms-filter: grayscale(100%);
  -o-filter: grayscale(100%);
  -webkit-filter: grayscale(1);
}
.iebrowser{
    background-color: #ddd ;
    opacity: 0.5;
    filter: Alpha(opacity=50);
}
.iebrowser .qq-nav .nav-mod{
    background-color: #b0b0b1 !important;
}

.iebrowser .searchBtn{
  background-color: #b0b0b1 !important;
}

.iebrowser .mod .hd .tit.active a{
  display: inline-block !important;
  color: #161617 !important;
  border-bottom: 4px solid #212121 !important;
}
.iebrowser .mod .bd .cate {
  color: #212222 !important;
}
.iebrowser  a:hover {
  color: #030303 !important;
}

.bgcolor1 {
    background: #f56300;
    color: #FFF;
    padding: 0 3px;
    border-radius: 3px;
}

.bgcolor1:hover {
    color: #FFF;
}
li.news-top-first {
  height:36px;
  text-indent: -2222px;
}

if(typeof crystal === 'undefined' && Math.random() <= 1) {
  (function() {
    var TIME_AFTER_LOAD_CRYSTAL = (new Date).getTime();
